#bg{
    width:100%;
    height:100%;
    background-color:transparent;
    mix-blend-mode:normal;
    z-index:0;
}

.sidebar-cables div, .sidebar__text-input textarea{
    --text-color: white;
    color:white;
    background-color:transparent;
}
.sidebar__group-header:hover, .sidebar__group div:hover{
    background-color: transparent;
}
.sidebar__group-header:hover{
    background-color: white;

}
 .sidebar__slider-input, .sidebar__slider{
    --sidebar-slider-input-height: 17px;
    border-radius:17px;
 }
 #title{
    font-size:90px;
    color:#D54020;
}
#interface, #interface div{
    mix-blend-mode: normal;
}
#cablescanvas code{
    max-width:25%;
}
.notification{
    visibility: hidden;
background-color: transparent;
color: white;
max-width:100%;
max-height:100%;
overflow:hidden;
margin: 16px;
position: absolute;
z-index: 9999;
font-size: 12px;
opacity:0;
border-radius:10px;
text-align:left;
left: 50%;
transform: translate(-50%, 0);

}
#info{
    width:200px;
    word-wrap: break-word;
}
